import React from "react";
import styled from "styled-components";

const Card = styled('div')`

align-items: center;
padding: 0px 20px;
border-radius: 10px;
flex: none;
order: 0;
flex-grow: 0;
margin: 0px 30px;
width: 300px;
max-width: 300px;
height: 310px;
`;

const CardWrapper = styled('div')`
display: flex;
justify-content: space-around;

`;


const CardContent = styled('p')`
font-style: normal;
font-weight: normal;
font-size: 14px;
line-height: 22px;
text-align: center;
color: #444444;
margin: 0px 0px;
`;

const Image = styled('img')`
width: 300px;
height: 200px;
filter: drop-shadow(1px 1px 10px rgba(0, 0, 0, 0.161));
border-radius: 10px;
margin: 20px 0px;
`;

export {Card, CardWrapper, CardContent, Image};
